('node', 'article', 0, 1, 1, 'und', 0, '<p>Liferay portal is a leading enterprise web platform which can be leveraged for developing effective business solutions for delivering immediate portal results and long term value to the organization. &nbsp;Today, broad arrays of organizations are using Liferay for building robust business solutions which deliver results including:</p>\r\n\r\n<ul>\r\n	<li>Enterprise application integration</li>\r\n	<li>Dynamic Web 2.0 supported websites</li>\r\n	<li>Self-service portals</li>\r\n	<li>Knowledge sharing web spaces</li>\r\n	<li>Revenue generating social networks</li>\r\n</ul>\r\n\r\n<p>Owing to numerous benefits that Liferay offers, many IT professionals and aspirants are considering the Liferay knowledge and expertise as one of the significant tools that can help in fetching rewarding jobs with great growth potential.</p>\r\n\r\n<p><strong>Attune World Wide offers online group training in Liferay</strong></p>\r\n\r\n<p>Technology has hit every aspect of our life and education is not an exception. Many people and learners now consider online trainings and education as a better and flexible approach as compared to its traditional classroom counterparts. With online training, one feels more comfortable as it eliminates the need to attend the classroom for a specific time period and at a static address. With mobile computing devices and laptops, online trainings can be accessed from any part of the world. Considering these imperative facts, we at Attune World Wide offer online group trainings to the learners who want to grab the vital Liferay deployment, implementation and administration knowledge along with practical exposure to the technology.</p>\r\n\r\n<p><strong>Why choose Attune World Wide?</strong></p>\r\n\r\n<p>With broad course objectives as given below, Attune World Wide possesses an expert team of Liferay professionals trained specifically through “Train the Trainer” program to be able to deliver world-class training.</p>\r\n\r\n<ul>\r\n	<li>Development of advance portals using Liferay</li>\r\n	<li>Developer environment setup for Liferay&nbsp;</li>\r\n	<li>Usage of Spring Hibernate with Liferay</li>\r\n	<li>Advanced layouts and theme designing using Liferay</li>\r\n	<li>Development and implementation of Liferay portlets with AJAX and Spring MVC</li>\r\n	<li>Integration of web services with Liferay</li>\r\n	<li>Facilitation of InterPortlet communication in Liferay</li>\r\n	<li>Liferay security administration and implementation with Users, Permissions, Groups and Roles</li>\r\n</ul>\r\n\r\n<p><strong><a href="http://www.attuneww.com/#contact" target="_blank">Attune World Wide</a></strong> &nbsp;is not only a leading name in the open source development and implementation, but also houses an expertise oriented team of professionals well-versed with all the concepts, development fundamentals, implementation strategies and troubleshooting tactics that can equip any Java professional or Liferay aspirant with profound knowledge of this portal development tool.&nbsp;</p>\r\n\r\n<p>With open source in great demand and inclination of companies towards Liferay, Attune World Wide is an ideal partner for you where you can get trained with some of the incredible Liferay skills. With Attune, you not only get the access to the live training sessions but you also get an opportunity to explore its e-book store where you can easily find professionally written e-books on a wide variety of open source technologies and topics.&nbsp;</p>\r\n\r\n<p>So, if Liferay training is the next thing in your mind, do not waste time and get started with our online group trainings on Liferay.</p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 2, 2, 'und', 0, '<p>Liferay Portal can serve an organization in several ways. A portal can be understood as a social platform that helps in building web applications and websites, and Liferay is a wonderful portal development framework.</p>\r\n\r\n<p>Liferay portals are beneficial in multiple ways and work exactly the way you want them to work. A Liferay portal not just simplifies your day to day work experience but also caters to your needs and preferences in an astounding ways. With a colossal 11 years long history of innovation, Liferay portal offers an incredible UI, multiple layers of desktop conventions and personalization that aid Liferay in quick adoption and ease of use.</p>\r\n\r\n<p><strong>Corporate Liferay Training</strong></p>\r\n\r\n<p>With more and more companies embracing Liferay as their portal development tool and framework, the demand for Liferay proficient professionals in the companies is also increasing. Not only the professional developers, but companies also require technical professionals who can easily use Liferay and carry out their day to day tasks through it.</p>\r\n\r\n<p>This calls for <a href="http://www.attuneuniversity.com/corporate-training/liferay.html" target="_blank"><strong>Corporate Liferay Training</strong></a><strong> </strong>in various capacities to ensure that an organization possesses the professionals with the apt Liferay skills so that it can use Liferay to augment its reach and productivity.</p>\r\n\r\n<p><strong>Attune World Wide Offers Best Corporate Training in Liferay</strong></p>\r\n\r\n<p>Realizing the rising demand of the Liferay savvy professionals in organizations in different capabilities, Attune World Wide has introduced extensive Liferay training covering an exhaustive list of Liferay topics ranging from basic use of Liferay tools &amp; portal to customized portal development.</p>\r\n\r\n<p>At <a href="http://www.attuneww.com/" target="_blank"><strong>Attune World Wide</strong></a> we completely understand that as time is changing, and technologies are getting advanced day by day, the demand for expertise oriented technical professionals among organizations is quite high. Thus, we strive to bridge the gap between technical proficiency requirements in an organization and right set of skills by delivering the best corporate training in a wide array of technological frameworks including Liferay.</p>\r\n\r\n<p>Our Liferay trainers are highly experienced Liferay developers and Liferay professionals who have garnered their experience by working as professional Liferay experts in real-world Liferay development, implementation and deployment projects. These trainers are not only possess expertise in Liferay development skills but also have exceptional teaching and interpersonal skills that help them deliver the training in a highly effective manner.</p>\r\n\r\n<p>The training structures are developed as per your requirements and specifications, and we ensure that our <a href="http://www.attuneuniversity.com/corporate-training/liferay.html" target="_blank"><strong>corporate Liferay Training</strong></a><strong> </strong>curriculum satisfies your<strong> </strong>requisites while addressing all the queries that your employees may have about Liferay implementation, development or any other related concept.&nbsp;</p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, '<div>\r\n<div>\r\n<div>\r\n<p>Liferay Portal is a leading and popular open source web platform which offers enterprise portal solutions using Web 2.0 and java technologies. It is majorly used for developing the integrated business solutions for network and content management, for creating customized web portals and for web publishing. Liferay can be rightly regarded as an all-encompassing package with proven abilities in document and content management across a broad spectrum of industries.</p>\r\n\r\n<p>Attune World Wide is a leading Liferay development and <strong><a href="http://www.attuneww.com/expertise/liferay.html" target="_blank"><strong>Liferay migration</strong></a></strong> service provider, serving a global clientele with their portal development requisites. Attune is known for its quick implementation and technical expertise in Liferay Portal solutions. Attune possesses a proven track record and vast experience in developing and designing portal for a wide array of industry segments.</p>\r\n\r\n<p><strong>Liferay Services Offered by Attune World Wide</strong></p>\r\n\r\n<p><em><strong>Liferay Consulting Services</strong></em></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Assessment and segregation of requisites</p>\r\n	</li>\r\n	<li>\r\n	<p>Development of workflows</p>\r\n	</li>\r\n	<li>\r\n	<p>Troubleshooting and debugging services</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Liferay Development Services</strong></em></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Single sign on and user identity management</p>\r\n	</li>\r\n	<li>\r\n	<p>Customized Portlets development using JSF Portlets and struts</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Liferay theme development</strong></p>\r\n	</li>\r\n	<li>\r\n	<p>Workflow management with the help of Alfresco records management</p>\r\n	</li>\r\n	<li>\r\n	<p>Development of collaboration tools including Forums, Blogs, Polls, and Wiki etc.</p>\r\n	</li>\r\n	<li>\r\n	<p>Open architecture based development</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Liferay Migration Services</strong></em></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Migration of document repositories to Liferay systems</p>\r\n	</li>\r\n	<li>\r\n	<p>Migration to Liferay from the enterprise content management platforms</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Why choose Attune World Wide?</strong></p>\r\n\r\n<p>Today, development of enterprise portals has become much simpler with the help of Liferay framework. Attune World Wide has been offering Liferay development services for years and possesses vast experience &amp; expertise in this niche of development. Over the years, Attune has developed extensive expertise in this technological framework which ensures that the development team at Attune World Wide possesses then proficiency and advanced capability in delivering outstanding Liferay solutions.</p>\r\n\r\n<p>At Attune World Wide, we keep an eye on all the latest and up to the minute development in techniques and technologies to serve our clients with superior quality Liferay solutions which can take their businesses on new heights. By considering the market trends and specific project requisites given by clients, we develop the most captivating web solutions with a comprehensive range of Liferay development tools.</p>\r\n\r\n<p>Our team of professionals possesses core understanding and profound knowledge pertaining to the portal development concepts. Thus, you can completely rely on the expertise and proficiency of our team to get your portals developed with optimum functionality and maximum support features.</p>\r\n\r\n<p>So, if you have ant requirement regarding the development of your organizational or social portals, you can contact our Liferay consulting team for a brief analysis of your requirements and <strong><a href="http://www.attuneww.com/services/consulting.html" target="_blank"><strong>Development Consultancy</strong></a>.</strong> Our Liferay portal development team will assist you with every query that you may have regarding the development.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, '<div>\r\n<div>\r\n<div>\r\n<p>With the introduction of online platforms and use of internet by people, the world is becoming a global village and geographical boundaries have started to vanish. Today, businesses are not just addressing their target audience in the geographical area in which they are operating; instead they are now targeting people from several parts of the globe. With an online website and offshore delivery services, any business, whether big or small, can create a unique place for itself with great success. All you need is the support of right technological tools, and your business is all set to take on the challenges as any big business house with global physical presence.</p>\r\n\r\n<p>Two of the most vital tools that can help your business not just grow but flourish viably across the continents include CMS (Content Management Systems) and Liferay. Both CMS and Liferay portal development can immensely benefit organizations of every size, whether small, medium or large.</p>\r\n\r\n<p><strong>How CMS development can benefit your business?</strong></p>\r\n\r\n<p><a href="http://www.attuneww.com/solutions/enterprise-cms.html" target="_blank"><strong>CMS web development </strong></a>become one of the most common practices among businesses globally. Back in the day, if any business wanted to make any changes to their bespoke static sites they were required to get in touch with their specialized web developers. But in our day and age, the scenario has completely changed, and today content has become king, while websites have become the most essential tool if you want to succeed in the present day’s highly competitive scenario,</p>\r\n\r\n<p>Today, you cannot design your websites as books where each block of content will always have a unique and unchanging location. Moreover, a website cannot be successful without the support of SEO (Search Engine Optimization). A CMS gives your website capabilities to implement efficient SEO techniques along with security, a hassle-free design, extensibility, and ease of installation. Also, by the implementation of a CMS, your business can improve its branding, mobile optimization and customer service. These are the factors which make a business big and successful.</p>\r\n\r\n<p><strong>A CMS can help your business in several ways including:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>By increasing its reach and efficiency</p>\r\n	</li>\r\n	<li>\r\n	<p>By improving your search engine rankings</p>\r\n	</li>\r\n	<li>\r\n	<p>By giving you complete control over your content</p>\r\n	</li>\r\n	<li>\r\n	<p>By helping your visitors in their information and product search</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>How Liferay portal development can benefit your business?</strong></p>\r\n\r\n<p><a href="http://www.attuneww.com/expertise/liferay.html" target="_blank"><strong>Liferay portal development</strong><strong> </strong></a>can help a business in more number of ways than you can imagine. With the right Liferay developer, even the smallest businesses can create compelling portals. The development tools provided by Liferay portlet are not just robust and flexible but are capable of satisfying a broad range of portal configurations and implementations right from the simplest CMS websites to the most complex business requisites.</p>\r\n\r\n<p>The rich set of collaboration features offered by this technology subsumes content management, web publishing, social networking and collaboration, and a wide array of functional tools innovatively designed for addressing the usability and technical concerns. One can design varied types of portal using Liferay and <strong>Liferay Performance Tuning </strong>to support businesses in various ways in today’s cutting edge online competitive scenario.</p>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'filtered_html'),
('node', 'article', 0, 5, 5, 'und', 0, '<p class="rtejustify">Managing the groundbreaking and unique changes in both business and technology over the last decade has created an ongoing IT infrastructure challenge for senior technology officers across the globe. In fact, over the last decade, the typical business application architecture is dramatically changing from desktop-centric installations, first to client/server solutions and nowadays to SOAs (Service-Oriented Architecture).</p>\r\n\r\n<p class="rtejustify">Recently, virtualization in computing has become of the most widely accepted ways for augmenting the reliability and reducing operations costs of enterprise IT. Along with all the evolving technology changes, the unprecedented acceleration and the speed of innovation in the introduction of new technological methodologies has fundamentally changed the way businesses work. As a result of technological developments, one concept which has become very popular and widely used is cloud computing.</p>\r\n\r\n<p class="rtejustify"><strong>Amazon Cloud Computing</strong></p>\r\n\r\n<p class="rtejustify">A <a href="http://www.attuneww.com/expertise/amazon-web-services.html" target="_blank"><strong>cloud computing solution</strong></a> enables organizations to share storage and computing resources and it eliminates the need for development, improvement and operation of individual infrastructure, among organizations.&nbsp;</p>\r\n\r\n<p class="rtejustify">Amazon’s AWS (Amazon Web Services) is a cloud computing platform which runs and facilitates virtualized computing resources at a large scale for the decentralized deployment of a service or a site. Using AWS, any organization can get the required storage or computing resources in minutes with an outstanding flexibility to choose the programming model or development platform which is most suitable for the problems you those businesses are trying to resolve. &nbsp;There are no long term commitments or any up-front costs for availing the Amazon’s cloud computing making it a highly cost-efficient way for delivering applications and hosting services.&nbsp;</p>\r\n\r\n<p class="rtejustify"><strong>Hosting Services Offered by Amazon Cloud Computing</strong></p>\r\n\r\n<p class="rtejustify">The Amazon EC2 (Amazon Elastic Compute Cloud) is a web oriented service offered by Amazon for the hosting requisites of its clients. It allows businesses to run the application programs in the computing environment provided by Amazon.com. It is designed with the aim of making the web-scale computing much easier for system administrators and developers.&nbsp;</p>\r\n\r\n<p class="rtejustify">Amazon’s EC2 possesses a simple web service interface which allows you to configure and obtain capacity with the minimal friction. You not only get complete control over your computing resources but it also considerably reduces the time required for obtaining and booting new server instances. This aids in the quick scaling of capacity, both up and down with the change in your computing requirements. Some other benefits include auto scaling as per your defined conditions, access to fully managed desktop computing services, facility of virtual private cloud along with highly callable &amp; available DNS web service.&nbsp;</p>\r\n\r\n<p class="rtejustify"><strong>Deployment of Amazon Cloud Computing&nbsp;</strong></p>\r\n\r\n<p class="rtejustify">Amazon provides an access management tool, known as IAM (AWS Identity and Access Management) which enables its users to securely control the access to all their AWS resources and services for their users. Using IAM, it becomes very easy to create and manage the AWS groups and users, along with usage of permissions for allowing and denying their access to the AWS services and resources.</p>\r\n\r\n<p class="rtejustify">Apart from this, Amazon also provides many other deployment and management services and interfaces including AWS CloudTrail, Amazon CloudWatch, AWS Elastic Beanstalk, AWS OpsWorks, AWS CloudHSM etc.</p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 6, 6, 'und', 0, '<p><strong>Its no more a buzz word : Cloud Computing</strong></p>\r\n\r\n<p><strong><em>We assure knowledge transfer with Cloud solution on your requirement</em></strong><br />\r\n<br />\r\nIf you are looking for expertise in cloud computing then you are on the right page. We at <strong>Attune Infocom</strong> is always ready to help you. Cloud computing has become an integral part of businesses of all sizes because it allows a company to focus on what they do best and get the optimum results without the hassle of hardware and software. The ease of management and flexibility of delivery with Attune Infocom approach on Rackspace as an authorizes partner make cloud services managed to become an ideal solution to many common business challenges from a small to large scale organizations.<br />\r\n<br />\r\nToday, cloud computing is in high demand, because it allows companies to scale with ease. We will help them to reduce the overall costing by the popular way of pay as they use whether it can be a simple processing, high volume storage or other cloud services. Our team of system administrator and consultants will offer optimize solution with daily monitoring over the usage on your cloud.<br />\r\n<br />\r\nThe cloud brings a high level of automation to tasks that in the past was not possible which can save companies time and money.<br />\r\n<br />\r\n<strong>Our cloud solutions include:</strong><br />\r\n<br />\r\n- Designing, Building &amp; Hosting Cloud Applications<br />\r\n- Setting up and building Online collaboration portals<br />\r\n- Business e-mail set up as well Migrating and Calendaring to Exchange Online<br />\r\n<br />\r\nWe have designed a special training course for organizations who wants to manage their application over the cloud. You can find more information on <strong>Cloud Computing Training</strong>at our website.<br />\r\n<br />\r\nThere are many different cloud computing solutions and our specialist team is dedicated to helping you simplify your information management, reducing your costs and enabling you to get on with running your business. Our cloud computing experts know this and can help you form a plan for your cloud implementation.</p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 7, 7, 'und', 0, '<p>Mule ESB (Enterprise Service Bus) is an ESB oriented integration offering by the developers of MuleSoft. It is a Java based lightweight ESB and integration platform which allows the developers to integrate and connect applications together easily and much hastily enabling them to carry out high speed data exchanges. Mule ESB enables integration of systems using different technologies much easily.&nbsp;</p>\r\n\r\n<p>When you are using Mule ESB, it does not matter which technologies (same or different) the applications are using. It can connect any application using HTTP, JDBC, Web Services, JMS and many more quite simply. These are some prominent reasons that Mule ESB is getting wide acceptance and a large percentage of enterprises spanning the globe are using it. &nbsp;</p>\r\n\r\n<p><strong>Benefits of Mule ESB</strong></p>\r\n\r\n<p>Some of the benefits offered by JBOSS ESB include:</p>\r\n\r\n<ul>\r\n	<li>It possesses an open source support which make it cost efficient and highly functional</li>\r\n	<li>It is one of the market leading open source middleware</li>\r\n	<li>It is a low price alternative to its proprietary pricey middleware platforms</li>\r\n	<li>It support next-generation ESB that includes business rules and workflow execution</li>\r\n	<li>It is a multi-platform ESB built on highest standards</li>\r\n</ul>\r\n\r\n<p><strong>When do you need Mule ESB consulting?</strong></p>\r\n\r\n<p>If your answer to one of more following questions is yes, then you need ESB solutions in your organization to enhance the productivity and communication of the applications.&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Are you integrating or connecting three or more services or applications?</li>\r\n	<li>Would you need to attach or plug-in more applications to this set up in future?</li>\r\n	<li>Do you require more than one type of application communication protocols in your enterprise?</li>\r\n	<li>Do you require publishing of services to be used by other applications?</li>\r\n	<li>Do you require message routing capabilities like aggregating message flows and forking or content based routing?</li>\r\n</ul>\r\n\r\n<p>If you are also facing some similar scenarios, then it’s the right time to implement <a href="http://www.attuneww.com/expertise/mule-esb.html" target="_blank"><strong>Mule ESB solutions</strong></a> in your organization. However, if you are facing any difficulties pertaining to the deployment of ESB solutions, Attune World Wide offers world-class consultation services for Mule ESB as one of the official MuleSoft System Integrators.&nbsp;</p>\r\n\r\n<p>We help you take right decisions regarding the deployment of ESB solutions and provide you with the best guidance using which you can take the right decisions pertaining to all your ESB implementations.&nbsp;</p>\r\n\r\n<p>Our professional consultants are highly proficient in carrying out the deep-delved analysis of your organizational needs to suggest you the most efficient and affordable solutions which not just help you save loads of money but also aid you in getting the best infrastructural set-up capable of supporting performance, scalability and reliability.&nbsp;</p>\r\n\r\n<p>To know more about our <strong>Mule ESB consulting</strong> services or any ESB implementations, contact us today to get a quick fix for the issues you are facing.&nbsp;</p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 8, 8, 'und', 0, '<div>\r\n<div>\r\n<div>\r\n<p>Open source learning and development provides support to businesses and people who are looking forward to take more structured approach towards managing the personal and organizational progress while enabling their organization to successfully face the challenges posed by the currently competitive market scenario.&nbsp;</p>\r\n\r\n<p>Learning and development have become one of the most basic aspects of technical industry today, and in this age, people need technical training more than ever to stay competitive in their jobs and businesses. Understanding the requisite for comprehensive <strong>open source development </strong>and training, Attune World Wide has come forward to offer world class training and development services in the open source arena.&nbsp;</p>\r\n\r\n<p><strong>Attune World Wide’s Open Source Development Services</strong></p>\r\n\r\n<p>Attune World Wide has pioneered the <strong>Open source development</strong> with great expertise in enterprise mobility solutions, product engineering and mission critical enterprise web applications. By choosing Attune, you can leverage the flexibility and power of the best open source solutions, technologies and ecosystem for a broad array of technology solutions requisites of your business. We offer a complete cycle of open source services subsuming consulting, development, application engineering, open source trainings and packaged product implementations as per your requirements and specifications.&nbsp;</p>\r\n\r\n<p>At <strong><a href="http://www.attuneww.com/#contact" target="_blank">Attune World Wide</a></strong> we are passionate about supporting the businesses to exploit the advantages offered by open source technologies. Our clients can benefit from cost savings and flexibility associated with opting for an open source technology instead of a proprietary one. The diversity, experience and expertise of our professional developers allow us to develop, implement and support an exhaustive range of open source technologies. Whatever your business may need, Attune World Wide possesses the proficiency to provide comprehensive services and support at the most advanced technical levels.</p>\r\n\r\n<p><strong>Attune World Wide’s Open Source Training Services</strong></p>\r\n\r\n<p>Training is an inseparable part of today’s highly competitive business scenario where we have developed immense dependence on technology. We provide both classroom and <strong><a href="http://www.attuneww.com/training/self-paced-training.html" target="_blank">self paced training courses</a></strong> focusing on open source frameworks and technologies. We help individuals to prepare for technical careers in the most demanded technologies by preparing them well on the technologies and by delivering comprehensive knowledge pertaining to a technology’s use in the current business set-up.&nbsp;</p>\r\n\r\n<p>Our <strong>open source training</strong> demonstrates our experience and expertise in core business disciplines. We have a team of expertise oriented faculties who possess vast experience in serving technical organizations and have worked on the real-life projects based on the technologies they teach.&nbsp;</p>\r\n\r\n<p>Thus, if you have any requirement for open source development or training, you can contact Attune World Wide and we ensure that we will give you the industry best solutions to satisfy your requisites and meeting your specifications. Our professionals are always ready to help and support you with your open source needs.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'filtered_html'),
('node', 'article', 0, 9, 9, 'und', 0, '<div>\r\n<div>\r\n<div>\r\n<p class="rtejustify">For implementing SOA (Service Oriented Architecture), the SOA principles must be supported by both infrastructure and applications. Enabling of the applications involves the development and creation of service interfaces to new or existing functions, either by using adapters or directly. At the most basic level, the enabling of infrastructure involves the provision of capability to transport and route service requests to the right service provider. The role played by ESB (Enterprise Service Bus) is to simply enable the infrastructure in this manner.&nbsp;</p>\r\n\r\n<p class="rtejustify">The true value of ESB concept, however, lies in enabling the infrastructure for <strong>SOA Architecture</strong> in a manner which coincides with the requisites of the enterprises in today’s environment, that is, to provide suitable manageability and service levels, and to integrate and operate in a heterogeneous environment. The implications of these requisites and specifications go much beyond basic routing and transport capability.</p>\r\n\r\n<p class="rtejustify">An ESB must enable the substitution of a service implementation by the other without any effect on the clients of that service. It requires both the service interfaces which the SOA has specified and that the ESB gives the functionality of invoking the services to the client code in a manner which is independent of the communication protocol which is involved and the service location.&nbsp;</p>\r\n\r\n<p class="rtejustify"><strong>Multiple Integration Paradigms are supported by ESB</strong></p>\r\n\r\n<p class="rtejustify">Whether proprietary or an <strong>open source ESB</strong>, in order to completely support the variety of interaction patterns which are required in a comprehensive SOA, for instance, &nbsp;events, publish/ subscribe, request / response, the ESB must support the following three major styles of Enterprise Integration in one infrastructure:</p>\r\n\r\n<p class="rtejustify">Message Driven Architectures</p>\r\n\r\n<p class="rtejustify">These are the architectures in which messages are sent by applications through ESB to the receiving applications, that is ESB facilitates communication via messages between sender and receiver.</p>\r\n\r\n<p class="rtejustify">Service Oriented Architectures</p>\r\n\r\n<p class="rtejustify">These are the architectures in which communication between applications is facilitated through reusable services with explicit, well-defined interfaces. Event communication models and underlying messages are leveraged by service-oriented interactions.&nbsp;</p>\r\n\r\n<p class="rtejustify">Event Driven Architectures</p>\r\n\r\n<p class="rtejustify">These are the architectures in which messages are generated and consumed by applications independently of each other.&nbsp;</p>\r\n\r\n<p class="rtejustify">The ESB facilitates this whilst providing additional capabilities for transforming or mediating the interactions and service messages, enabling a broad spectrum of behaviors and supporting different models of coupling interaction.</p>\r\n\r\n<p class="rtejustify">ESB also distributes processing and centralizes control and is sometimes also described as distributed infrastructure.</p>\r\n\r\n<p class="rtejustify">Attune World Wide is a leading organization that provides ESB consulting, <strong><a href="http://www.attuneww.com/expertise/mule-esb.html">development and training services</a></strong>. It majorly offers Mule ESB services as it is an <strong>open source ESB</strong> offering a wide range of benefits often not provided by proprietary ESBs including cost benefits and flexibility. If you have any ESB oriented organizational requirement you can contact us for efficient ESB solutions.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'filtered_html'),
('node', 'article', 0, 10, 10, 'und', 0, '<div>\r\n<div>\r\n<div>\r\n<p>An Enterprise Service Bus (ESB) is software architecture for middleware that can help your organization to develop and maintain an effective enterprise IT architecture. An ESB helps you continuously lower down the IT cost to the business, respond hastily to the new business requirements, be flexible and agile, and seamlessly integrate applications, existing and new customers and business partners as well as cloud services. Basically, an <strong><a href="http://www.attuneww.com/expertise/mule-esb.html" target="_blank">ESB</a></strong> &nbsp;is a system with which all the services of an organization are connected and it helps in accessing all the services with ease.</p>\r\n\r\n<p><strong>Some of the most interesting facts pertaining to Enterprise Service Bus subsume:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Open Source ESB</strong> like Mule ESB completely takes away the pain involved in integration by delivering everything which is needed for connecting the enterprise to cloud and on-premises systems on an open and single platform.<br />\r\n	&nbsp;</li>\r\n	<li>One of the most sought after features of ESB is that it acts as a single point of access. Thus, the biggest advantage of connecting all the services and clients through an enterprise service bus is that clients need only to look for services at a single location which is the ESB itself. If a service is moved from a server to be run by another server, all you need to do is to reconfigure the ESB and the clients will still access the service by ESB. This implies that change in location will not affect the functioning of the service.<br />\r\n	&nbsp;</li>\r\n	<li>Another interesting fact about ESB is that it can act as transaction manager by coordinating distributed in which multiple services participate. Instead of forcing the client to manage these transactions, ESB does it by itself.<br />\r\n	&nbsp;</li>\r\n	<li>ESB can also act as the Security Manager by implementing the security aspects including authorization and authentication. Even if an application’s service does not have any authorization and authentication, the ESB can need these in the service interface which is exposed to the client.<br />\r\n	&nbsp;</li>\r\n	<li>An <strong>Enterprise Service Bus</strong> solution can act as the gateway to the world. If some clients need access and connection to the services which are running in the outside world, they can use ESB which can potentially function as a gateway for these services.<br />\r\n	&nbsp;</li>\r\n	<li>An ESB can easily and quickly distribute information across an enterprise whilst masking any differences among the software architectures, network protocols and the underlying platforms.<br />\r\n	&nbsp;</li>\r\n	<li>An ESB has the capability to provide incremental enterprise solution implementations so that all the enterprise applications and services do not need to be changed all at once or immediately.<br />\r\n	&nbsp;</li>\r\n	<li>As per IBM ESB cannot be regarded as a new software product, rather it is a new way of looking at how applications can be integrated, information can be manipulated and resources can be coordinated.</li>\r\n</ul>\r\n\r\n<p>These were some of the most interesting facts about ESBs. <strong><a href="http://www.attuneww.com/#contact" target="_blank">Attune World Wide</a></strong>&nbsp; provides superior ESB solutions and consulting services in a cost-efficient manner.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'filtered_html'),
('node', 'article', 0, 11, 11, 'und', 0, '<div>\r\n<div>\r\n<div>\r\n<p>Data exchanges between the companies have increased significantly and the number of organizational applications which must be integrated has also increased significantly. As a solution, companies prefer to use ESB (Enterprise Service Bus) in almost every sort of integration project, no matter which data formats, transport protocols, technologies or environments such as .Net or Java are used. Though the decision to implement and use ESB is an easy one to make, the difficulty arises when one has to decide which ESB to use?</p>\r\n\r\n<p>This blog is intended to help you by explaining why should you choose to use ESB and which one to choose.</p>\r\n\r\n<p><strong>Oracle Service Bus</strong></p>\r\n\r\n<p>It is a proprietary ESB from oracle. It is a component of the OFM (Oracle Fusion Middleware) Stack. There is hardly any functionality which Oracle has not provided in its ESB. The tools are quite stable and powerful while for most of the products graphical editors are there. Support is also provided by the database giant for the most conceivable SLAs (Service Level Agreements).</p>\r\n\r\n<p>The OFM is based on the industry standards such as SCA, SOAP, BPEL, or Java EE. These products are proprietary and hail from multiple acquisitions that Oracle has made over time. This proprietary ESB suite can offer almost every conceivable function and covers almost all the SLAs. However, many of these SLAs or functionalities are not required in most of the projects.</p>\r\n\r\n<p><strong>Mule ESB</strong></p>\r\n\r\n<p>It is an <strong>open source ESB</strong> which possesses a broad array of features including intuitive Eclipse based tooling and simple installation. It is very lightweight and extensible ESB solution, and part from its open source version also comes in commercial enterprise version. Some imperative advantages offered by Mule ESB include availability of B2B product connectors such as for Salesforce or SAP, and efficient implementation of the integration scenarios through graphical editors.&nbsp; However, it misses on the functionality of a suite. Another negative aspect of Mule ESB is the small community.&nbsp;</p>\r\n\r\n<p><strong>Fuse ESB</strong></p>\r\n\r\n<p>Like Mule ESB, Fuse ESB is also a pure ESB and is not a suite. Its basis lies in the actual standards in the integration environment like Apache Camel and Apache CFX. Fuse ESB was earlier a part of FuseSource, but after Redhat’s acquisition it has come under JBOSS division. In order to become a unified suite Fuse ESB has to wait for some more time and it will be integrated into JBOSS Enterprise SOA platform.</p>\r\n\r\n<p><strong>Conclusion</strong></p>\r\n\r\n<p>There is no silver bullet which can solve all your integration problems. Out of the above mentioned three Enterprise Service Bus Solutions proprietary solution from Oracle can be a good choice for those who can afford a perceived higher complexity and higher costs in lieu of strong support and high functionality. On the other hand, open source solution like MuleESB can be a wise choice as it offers a rich set of features, flexibility, and ease of use and relatively lower costs.</p>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'filtered_html'),
('node', 'article', 0, 12, 12, 'und', 0, '<p>Activiti is an open source lightweight workflow and BPM (Business Process Management) Platform targeted at system administrators, business personnel and developers. Apart from efficiently managing business processes, it provides a highly extendible and scalable java based Workflow. The core of Activiti BPM is composed by robust and very fast BPMN 2 process engine for Java. Activiti can run in any sort of Java application, on a cluster, in the cloud or on a server. It can perfectly integrate with Spring.</p>\r\n\r\n<p><strong>Components op Activiti</strong></p>\r\n\r\n<p>Activiti is comprised by different components which are segregated under three major categories including Runtime, Modeling and Management. Different components of Activiti include:</p>\r\n\r\n<p><strong>Activiti Engine</strong></p>\r\n\r\n<p>It is a Java process engine which is actually the heart or core of Activiti. It natively runs on BPMN 2 processes and possesses the following properties:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Extremely fast working and robustness</p>\r\n	</li>\r\n	<li>\r\n	<p>Can be easily get up and made running with the setup utility</p>\r\n	</li>\r\n	<li>\r\n	<p>Allows the user updates to be easily combined with process updates through a single transaction</p>\r\n	</li>\r\n	<li>\r\n	<p>It facilitates asynchronous continuations and transactional timers</p>\r\n	</li>\r\n	<li>\r\n	<p>It is built to support the cloud scalability</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Activiti Explorer</strong></p>\r\n\r\n<p>It is a web application which provides an access to the core component Activiti Engine runtime for all the users on the system. It includes tasks like process instance inspection, task management and management features along with capability to view reports on the basis of statistical history data.</p>\r\n\r\n<p><strong>Activiti Modeler</strong></p>\r\n\r\n<p>It is KIS BPM process solution’s open source version which can be used for authoring BPMN 2.0 compliant processes through graphical interfaces. The server stores the process files in a database model repository.</p>\r\n\r\n<p>KIS BPM provides an effective solution for the management of your Activiti projects in an online, web-only environment. It can also help you in the management of your different Activiti deployments and servers. Additionally, you can use the palette editor for completely customizing the web modeler palatte. A web form editor is also included in the KIS BPM solution. With the right <a href="http://www.attuneuniversity.com/training/corporate-online/corporate-activity-advanced-five.html" target="_blank"><strong>Activiti training </strong></a>.one can easily learn the usage of KIS BPM and become efficient at management of various aspects of Activiti.</p>\r\n\r\n<p><strong>Activiti Designer</strong></p>\r\n\r\n<p>It is fundamentally an eclipse plugin which helps you in modeling of BPMN 2.0 processes from inside your IDE environment. It also possesses an inbuilt <strong>Activiti support </strong>for the specific extensions of Activiti in order to enable you to use the optimum potential of both the engine and the processes.</p>\r\n\r\n<p>There are several plug-ability points to allow the addition of the supplementary building blocks to the process over the regular BPMN 2.0, customized for your business domain and specific use cases.&nbsp;</p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 13, 13, 'und', 0, '<p><strong>Make business process more efficient with Attune Infocom – Activiti training</strong></p>\r\n\r\n<p>Activiti is a brand new Open Source BPM Platform added in Attune Infocom expertise list as one of the offering in BPM solution. Comparing other Open Source Workflow Engines Activiti targets not only the technical execution of processes, but the Business-IT-Alignment as well. Activiti builds on top of the global Standard BPMN 2.0, while staying developer friendly. We are one of the pioneer offering Activiti BPM training in global market.</p>\r\n\r\n<p>Attune Infocom 3 days training plan carry you along with practical examples how Activiti works and how it can be used successfully. Our approach to training is to get equal weightage on theory as well practice using Activiti with a lot of practical exercises throughout the training. A participant will benefit from our profound experience with BPM and Process Engines. After the training we enabled candidate to asses the potentials and boundaries of Activiti, including the brand new BPMN 2.0. After the training, one can be ready to start working with Activiti. Our training methodology will help to gain an understanding of how business IT alignment works with Activiti.</p>\r\n\r\n<p>In our three-day training we offer in depth knowledge on open source BPM Platform Activiti and enable organizations to successfully implement projects. Activiti can be used as a lightweight workflow engine, as BPM Suite or as the core of company wide SOA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Attune Infocom other service offerings using Avtiviti BPM</strong></p>\r\n\r\n<p>Beside our Activiti training offerings we can help organizations to avail expert consulting and development support on BPM project using BPMN and Activiti:<br />\r\n<br />\r\n- Workshop and Coaching<br />\r\n- Project Support<br />\r\n- Enabling and Support</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Objective for Activiti BPM Training</strong></p>\r\n\r\n<p>This three days training is useful to Technical Architect, Senior Developer, Project Manager and System Integrator. This training is focusing on Open source ActivitiBPM, BPMN 2.0 standards and Activit integration with Mule ESB and jBoss Drool. This course covers details on how to install, configure, create and deploy BPMN 2.0 Business processes using Activiti. After this training you will be familiar with BMPM 2.0 business processes, services orchestration, process deployment, execution, testing and monitoring using Activiti.<br />\r\n<br />\r\nDay 1: BPMN 2.0 &amp; Activiti<br />\r\nDay 2: Activiti Process Engine<br />\r\nDay 3: Advanced BPMN 2.0 and Extensions</p>\r\n', '', 'filtered_html');
